import React, { Component } from 'react';
import Header from './components/Header/Header';
import Radium, { StyleRoot } from 'radium';
import './App.css';



class App extends Component {
  render() {
    return (
      <StyleRoot>
        <div className="App">
          <Header />
        </div>
      </StyleRoot>
    );
  }
}

export default Radium(App);
